import React from 'react';
import Text from '../components/text';
import Container from '../components/container';
import Layout from '../components/Layout';

const Index = () => (
  <Container>
    <Layout></Layout>
    <style jsx global>
      {`
        body {
          display: flex;
          justify-content: center;
          align-items: center;
        }
      `}
    </style>
  </Container>
);

export default Index;
